import { useState, useEffect } from 'react'
import MenuHeader from './MenuHeader'
import Items from './Items'

const Menu = ({menuData}) => {
    let mains;
    if(menuData.length>0) {
        mains = menuData[0];
    } else {
        mains = [];
    }

    return (

        <div>
            <MenuHeader />
            <div className='menu-wrapper'>
                <div className='menu-container'>
                    <Items items={mains} />
                </div>
            </div>
        </div>
    );
};

export default Menu;
